class Solution(object):
    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """
        if not s :
            return ''
        elif not t :
            return ''
        minlength = len(t)
        maxlength = len(s)
        result = []
        checkcount = 0
        for size in range(minlength, maxlength + 1, 1):
            operatorindex = 0
            while operatorindex + size <= maxlength:
                tmp = s[operatorindex : operatorindex + size]
                resulttmp = tmp
                for part in t :
                    if part in tmp:
                        index = tmp.find(part)
                        tmp = tmp[:index] + tmp[index+1:]
                        checkcount += 1
                    if checkcount == minlength:
                        result.append(resulttmp)
                        return result[0]
                checkcount = 0
                operatorindex += 1
        print(result)
        return result[0] if len(result) > 0 else ''
        

if __name__ == "__main__":
    S = ""
    T = ""
    #S = "bbaa"
    #T = "aba"
    idealresult = "baa"
    result = Solution().minWindow(S,T)
    print(result)
    assert result == idealresult, False